import React from "react";
import "./Banner.css";
import { FaAngleRight } from "react-icons/fa6";

function Banner() {
  return (
    <div className="Banner">
      <h1 className="h1">ASUS ExpertBook B5 OLED</h1>
      <p className="p">The world's lightest 16" business laptop</p>
      <p>
        Learn more <FaAngleRight />
      </p>
    </div>
  );
}

export default Banner;
